import React from 'react';

const AdminDashboard = () => {
	return (
		<div className="fitaddict-bg" style={{minHeight:'100vh',display:'flex',alignItems:'center',justifyContent:'center'}}>
			<div style={{
				width: 600,
				background: '#fff',
				borderRadius: 24,
				boxShadow: '0 6px 24px -4px rgba(99,102,241,0.10), 0 1.5px 6px 0 rgba(168,85,247,0.08)',
				padding: '2.5rem 2rem',
				border: '1.5px solid #e0e7ff',
				textAlign: 'center'
			}}>
				<h1 style={{background:'linear-gradient(90deg,#7c3aed 0%,#a21caf 50%,#a855f7 100%)',WebkitBackgroundClip:'text',WebkitTextFillColor:'transparent',fontWeight:900,marginBottom:'2rem',letterSpacing:1}}>Admin Dashboard</h1>
				<div style={{fontSize:'1.15rem',color:'#334155',marginBottom:'1.5rem'}}>
					ยินดีต้อนรับสู่หน้าแดชบอร์ดผู้ดูแลระบบ<br/>
					(เพิ่มเนื้อหา/เมนู admin ได้ตามต้องการ)
				</div>
			</div>
		</div>
	);
};

export default AdminDashboard;
